import React from "react";

export default function Materials() {
    return (
        <>
        <div className="container">
            <div className="row">
            <div className="col-md-12">
                <h1>Materials</h1>
                <p>
                This page is under construction. Please check back later for more
                updates.
                </p>
            </div>
            </div>
        </div>
        </>
    );
}
